import CartWidget from "../CartWidget/CartWidget";

const NavBar = () => {
  return (
    <nav className="navbar navbar-expand-lg">
      <h3>Donatto</h3>
      <ul>
        <li>Productos</li>
        <li>Nosotros</li>
        <li>Para Empresas</li>
        <li>Carrito</li>
        <CartWidget />
      </ul>
    </nav>
  );
};

export default NavBar;
